.selected .fixtureName {
    background-image: radial-gradient(#bbbbff, #775577);
    cursor: auto;
}

.fixtureName:hover {
    background-image: radial-gradient(#aaaaff, #5555aa);
    cursor: pointer;
}

.tests {
    overflow: auto;
    margin-top: -0.4vw;
}

.test {
    padding: 0.2vw;
    visibility: hidden;
    margin: 0;
    padding-left: 1vw;
    padding-right: 2vw;
    text-align: center;
    border-radius: 1.5vw;
    font-weight: bold;
    white-space: pre-line;
    font-size: 1.2vw;
    position: absolute;
    top: 0;
}

.test:hover {
    cursor: pointer;
}

.test[status='passed']{
    background-image: radial-gradient(rgba(85,126,85,0.5), rgba(0,221,0,0.75));
}

.test[status='failed']{
    background-image: radial-gradient(rgb(136,85,85, 0.4), rgba(251, 0, 0, 0.8));
}

.test[status='broken']{
    background-image: radial-gradient(rgba(221,221,0,0.5), rgba(126,126,0,0.8));
}

.test[status='skipped']{
    background-image: radial-gradient(rgba(221,221,221), rgba(126,126,126));
}

.test[status='passed']:hover{
    background-image: radial-gradient(#558855, #00dd00, #558855);
}

.test[status='failed']:hover{
    background-image: radial-gradient(#885555, rgba(221,0,0, 0.7), #885555);
}

.test[status='broken']:hover{
    background-image: radial-gradient(#aabb11, #dddd00, #888800);
}

.test[status='skipped']:hover{
    background-image: radial-gradient(#555555, #dddddd, #888888);
}

.selected .test{
    visibility: visible;
    margin: 0.5%;
    position: initial;
}

.test.visible {
    visibility: visible;
    margin: 1%;
    position: initial;
}

.test.hidden, .fixture.hidden, .test.search-hidden, .fixture.search-hidden, .test.tag-hidden, .fixture.tag-hidden {
    visibility: hidden;
    position: absolute;
    top: 0;
}

.test.selected {
    border: slateblue ridge 0.2vw;
    font-size: 1.35vw;
    padding-top: 0.45vw;
}

  background-repeat: no-repeat;
  -webkit-background-size: cover;
  -moz-background-size: cover;
  -o-background-size: cover;
  background-size: 100% 100%;
  opacity: 0.5;
  height: 100%;
  width: inherit;
  position: absolute;
  z-index: -1;
}

.step div {
  border-style: inset outset;
  cursor: zoom-out;
}

.step[hiddenInfo] div {
  cursor: zoom-in;
}

.step[hiddenInfo] .subStep {
  visibility: hidden;
  position: absolute;
}

.step .subStep {
  padding-left: 4vw;
}

#run-info {
  position: absolute;
  bottom: 55vh;
  left: 4vw;
  font-size: 1.75vw;
  font-family: cursive;
  color: cornsilk;
}

#run-info:nth-child(1) {
  top: 8vw;
}

#error-info {
  position: inherit;
  top: 6vh;
  margin: 3.5vh 6.5vw 0;
  width: 35vw;
}

#error-info:empty {
  position: absolute;
  top: 0;
}

.stack-line {
  display: none;
}

.error-expanded .stack-line {
  display: block;
}

#error-info:hover {
  cursor: pointer;
}

#error-info a:hover {
  cursor: alias;
}

.error {
  position: relative;
  width: inherit;
  height: fit-content;
  padding: 1vh 1vw;
  margin-bottom: 1vw;
}

.error:only-child {
  top: 3vh;
}

.error::after {
  content: "";
  background: rgb(150, 50, 50);
  width: 100%;
  background-size: 100% 100%;
  height: 100%;
  position: absolute;
  z-index: -1;
  opacity: 0.8;
  left: 0;
  top: 0;
}

.error:hover::after {

/* eslint-disable no-unused-vars */

function onLoad () {
    if (stepsData.length === 0) {
        this.document.querySelectorAll('div[fixtureId]').forEach(el => {
            stepsData.push({
                id: el.getAttribute('fixtureId'),

                steps: el.outerHTML,

                screenshot: el.getAttribute('screenshot'),

                durationMs: el.getAttribute('durationMs'),

                userAgent: el.getAttribute('userAgent'),

                stackTrace: ''
            });
            el.remove();
        });
        
        for (let index = 0; index < stepsData.length; index++) {
            const stackTraceElement = this.document.querySelector(`div[traceId='${stepsData[index].id}']`);
            
            if (stackTraceElement) {
                stepsData[index].stackTrace = JSON.parse(stackTraceElement.textContent);
                stackTraceElement.remove();
            }
        }
    }
    this.addSummary();
    this.addFixtureSummary();
    this.addSearchByFixtureListeners();
}

/* eslint-enable no-unused-vars */

if (this.window.onload) 
    this.window.onload += onLoad;
else
    this.window.onload = onLoad;

function appendSummaryElement (testStatuses, elementToAppend, withName) {
    ['passed', 'failed', 'broken', 'skipped'].forEach(statusName => {
        const statusesObject = testStatuses.find(el => el.name === statusName);
        const statusesCount = statusesObject ? statusesObject.count : 0;

        if (statusesCount) {
            const statusEl = this.document.createElement('div');

            statusEl.classList.add(statusName);
            statusEl.onclick = this.filterTests;
            statusEl.textContent = `${withName ? `${statusName.charAt(0).toUpperCase() + statusName.slice(1)}: ` : ''}${statusesCount}`;
            elementToAppend.appendChild(statusEl);    
        }
    });
}

function addSummary (elementWithTests, elementToAppend) {
    const testStatuses = [];

    elementWithTests = elementWithTests ? elementWithTests : this.document;
    elementWithTests.querySelectorAll('.test').forEach(test => {
        const currentStatus = test.getAttribute('status');
        const statusIndex = testStatuses.findIndex(status => status.name === currentStatus);

        if (statusIndex === -1)
            testStatuses.push({ name: currentStatus, count: 1 });
        else
            testStatuses[statusIndex].count++;
    });
    appendSummaryElement(testStatuses, elementToAppend ? elementToAppend : this.document.querySelector('body > .summary'), !elementToAppend);
}

function addFixtureSummary () {
    this.document.querySelectorAll('.fixture').forEach(fixture => {
        addSummary(fixture, fixture.querySelector('.summary'));
    });
}

/* eslint-disable no-undef */

function onSearch (searchValue) {
    const isSearchByFixtureEnabled = document.querySelector('#searchFixture').getAttribute('enabled') === 'true';
    
    this.document.querySelectorAll('.fixture').forEach(fixture => {
        const isFixtureExactSearch = isSearchByFixtureEnabled && fixture.querySelector('.fixtureName').textContent.toLowerCase().includes(searchValue.toLowerCase());

        fixture.querySelectorAll('.test').forEach(test => {
            const isTestExactSearch = test.textContent.toLowerCase().includes(searchValue.toLowerCase());

            test.classList[isTestExactSearch || isFixtureExactSearch ? 'remove' : 'add']('search-hidden');
        });

        if (!fixture.classList.contains('hidden')) {
            const isFixtureTestsHidden = fixture.querySelectorAll('.test:not([class*=hidden])').length === 0;
        
            fixture.classList[isFixtureTestsHidden ? 'add' : 'remove']('hidden');    
        }
    });
}

function filterTests (event) {
    const status = event.target.classList[0];
    const methodName = event.target.classList.contains('filtered') ? 'remove' : 'add';
    const isFixture = event.target.parentElement.parentElement.classList.contains('fixture');
    const filterFunction = (fixture) => {
        fixture.querySelectorAll(`.test[status='${status}']`).forEach(test => {
            test.classList[methodName]('hidden');
        });

        fixture.classList[fixture.querySelectorAll('.test:not(.hidden)').length === 0 ? 'add' : 'remove']('hidden');
    };

    if (isFixture) {
        filterFunction(event.target.parentElement.parentElement);
        event.target.classList[methodName]('filtered');

        const filteredCount = document.querySelectorAll(`.fixture .${status}.filtered`).length;
        
        if (filteredCount === 0)
            document.querySelector(`body > .summary .${status}`).classList.remove('filtered');
        else if (filteredCount === document.querySelectorAll(`.fixture .${status}`).length)
            document.querySelector(`body > .summary .${status}`).classList.add('filtered');
    }
    else {
        document.querySelectorAll('.fixture').forEach(fixture => filterFunction(fixture));
        document.querySelectorAll(`.summary .${status}`).forEach(el => el.classList[methodName]('filtered'));
    }
    onSearch(document.querySelector('#search').value);
}

function filterByTag (element) {
    const isFilteredOnClick = element.classList.contains('filtered');
    const methodName = isFilteredOnClick ? 'remove' : 'add';
    
    element.classList[methodName]('filtered');

    document.querySelectorAll('.fixture').forEach(fixture => {
        fixture.querySelectorAll('.test').forEach(test => {
            if (test.querySelector('.tag.hidden')) test.classList[methodName]('tag-hidden');
        });
        if (fixture.querySelector(".test:not([class*='hidden'])") && isFilteredOnClick || !fixture.querySelector(".test:not([class*='hidden'])") && !isFilteredOnClick)
            fixture.classList[methodName]('hidden');
    });
}

function onSearchButtonMove (event) {
    if (!document.querySelector('#searchFixtureTooltip')) {
        const tooltip = document.createElement('div');

        tooltip.id = 'searchFixtureTooltip';
        document.querySelector('body > .summary').appendChild(tooltip);
    }
    const tooltip = document.querySelector('#searchFixtureTooltip');

    tooltip.textContent = document.querySelector('#searchFixture').getAttribute('enabled') === 'false' ? 'Search by fixture and test' : 'Search only by test';
    tooltip.style.top = `${event.clientY}px`;
    tooltip.style.left = `${event.clientX}px`;
}

function onSearchButtonLeave () {
    const tooltip = document.querySelector('#searchFixtureTooltip');

    if (tooltip) tooltip.remove();
}

function onSearchButtonClick (event) {
    event.target.setAttribute('enabled', event.target.getAttribute('enabled') !== 'true');
    this.onSearchButtonMove(event);
}

function addSearchByFixtureListeners () {
    const btnSearchByFixture = document.querySelector('#searchFixture');
    
    btnSearchByFixture.onclick = onSearchButtonClick;
    btnSearchByFixture.onmouseleave = onSearchButtonLeave;
    btnSearchByFixture.onmousemove = onSearchButtonMove;
}

/* eslint-enable no-undef */
/* eslint-enable no-unused-vars */
</script><script>/* eslint-disable no-unused-vars */

        screenOnLeave();
    else
        screenOnHover();

function screenOnLeave () {
    document.querySelector('#screenshot img').classList.remove('increased');

function errorOnClick (event) {
    const errorBlock = event.target.parentElement;
    const body = document.querySelector('body');
    const testInfo = document.querySelector('.test-info');
    const errorHeight = errorBlock.getBoundingClientRect().height;
    const isExpanded = errorBlock.classList.contains('error-expanded');

    errorBlock.classList[isExpanded ? 'remove' : 'add']('error-expanded');

    const expandedErrorBlock = document.querySelectorAll('error-expanded');
    const errorOffset = errorBlock.getBoundingClientRect().height - errorHeight;

    body.style.height = expandedErrorBlock ? `${errorOffset + body.getBoundingClientRect().height}px` : '';
    testInfo.style.height = expandedErrorBlock ? `${errorOffset + testInfo.getBoundingClientRect().height}px` : '';
}

function stepOnClick (stepNameElement) {
    const stepBlock = stepNameElement.parentElement;

    if (stepBlock.hasAttribute('hiddenInfo')) stepBlock.removeAttribute('hiddenInfo');
    else stepBlock.setAttribute('hiddenInfo', '');
}

</script><script>/* eslint-disable no-unused-vars */

function onFixtureClick (element) {
    const isCurrentFixtureSelected = element.parentElement.classList.contains('selected');

    element.parentElement.classList[isCurrentFixtureSelected ? 'remove' : 'add']('selected');
    if (!isCurrentFixtureSelected) this.setTagsPosition(element.parentElement);
}

function setTagsPosition (fixture) {
    fixture.querySelectorAll('.test .tag').forEach(tag => {
        if (!tag.style.top) {
            const parentRect = tag.parentElement.getBoundingClientRect();
            const tagRect = tag.getBoundingClientRect();
            const expectedY = parentRect.top + parentRect.height / 2 - tagRect.height / 2;
            
            tag.style.top = `${expectedY - tagRect.top}px`;
        }
    });
}

function addStackTrace (stackTrace) {
    const testInfoNode = this.document.querySelector('.test-info');
    const trace = this.document.createElement('div');
        
    trace.id = 'error-info';
    testInfoNode.insertBefore(trace, testInfoNode.childNodes[0]);
    
    const errorsNode = this.document.querySelector('#error-info');

    for (const error of stackTrace) {
        const errorName = this.document.createElement('div');
        const errorBlock = this.document.createElement('div');
    
        errorBlock.classList.add('error');
        errorName.classList.add('error-name');
        errorName.innerHTML = error[0].replace(/\n/g, '<br>');
        errorName.onclick = this.errorOnClick;
        errorBlock.appendChild(errorName);
    
        for (let index = 1; index < error.length; index++) {
            const stackLineText = error[index];
            const stackLine = this.document.createElement('div');
            
            stackLine.classList.add('stack-line');
            stackLine.innerHTML = stackLineText.replace('()@', ' ').replace(/((\w:)?\\.*?:\d*:\d*)/g, '<a href="vscode://file/$1">$1</a>');

            errorBlock.appendChild(stackLine);
        }

        errorsNode.appendChild(errorBlock);
    }
    setErrorFont();
}

function setErrorFont () {
    const errorNames = this.document.querySelectorAll('.error-name');

    let errorNamesLength = 0;

    errorNames.forEach(err => {
        errorNamesLength += err.textContent.trim().length;
    });
    
    const contentLengthOffset = errorNamesLength / 550;

    if (contentLengthOffset > 1) {
        const fontSize = this.document.querySelector('#error-info').getBoundingClientRect().height / 14;

        errorNames.forEach(err => {
            err.style.fontSize = `${Math.round(fontSize / contentLengthOffset)}px`;
        });
    }
}

function addTestInfo (testData) {
    if (testData.screenshot) {
        const screen = this.document.createElement('img');

        screen.src = testData.screenshot;
        screen.onclick = this.screenOnClick;
        screen.onmouseover = this.screenOnHover;
        screen.onmouseleave = this.screenOnLeave;
        this.document.querySelector('#screenshot').appendChild(screen);
    }

    const el = this.document.querySelector('#error-info');

    if (el) el.remove();
    if (testData.stackTrace) this.addStackTrace(testData.stackTrace);
        
    const duration = this.document.createElement('div');
    const userAgent = this.document.createElement('div');

    duration.textContent = `Test duration: ${testData.durationMs}`;
    duration.classList.add('duration');
    userAgent.textContent = `Completed on: ${testData.userAgent}`;
    userAgent.classList.add('userAgent');

    this.document.querySelector('#run-info').appendChild(duration);
    this.document.querySelector('#run-info').appendChild(userAgent);    
}

function clearTestInfo (testInfoElement) {
    this.document.querySelector('body').style.height = '';
    testInfoElement.style.height = '';
    testInfoElement.classList.remove('error-expanded');
    testInfoElement.classList.remove('selected');

    this.document.querySelectorAll('.test.selected').forEach(el => {
        el.classList.remove('selected');
    });
    this.document.querySelectorAll('div.stepsContent, #screenshot img, #run-info *, #error-info *').forEach(el => {
        el.remove();
    });
}

function testOnClick (element) {
    if (element.classList.contains('selected')) return;

    const testInfo = this.document.querySelector('.test-info');

    this.clearTestInfo(testInfo);
    element.classList.add('selected');

    if (element.getAttribute('status') === 'skipped') return;

    this.stepsData.forEach(data => {
        if (data.id === element.id) {
            const child = this.document.createElement('div');

            child.classList.add('stepsContent');
            child.innerHTML = data.steps;
            testInfo.appendChild(child);
            testInfo.classList.add('selected');

            this.addTestInfo(data);
            return;
        }
    });
}

function tagOnClick (element) {
    const methodName = element.classList.contains('hidden') ? 'remove' : 'add';

    element.classList[methodName]('hidden');
    if (this.document.querySelector('.summary .tag.filtered')) {
        element.parentElement.classList.add('tag-hidden');
        if (!element.parentElement.parentElement.parentElement.querySelector('.test:not([class*=hidden])'))
            element.parentElement.parentElement.parentElement.classList.add('hidden');
    }
}

/* eslint-enable no-unused-vars */
</script></head>
